// import './App.css'
import React from 'react'
import LoginPage from './components/LoginPage';
import RegisterAddress from './components/RegisterPageAddress';
import MainStatusPage from './components/MainStatusPage';
import RegisterPageUsername from './components/RegisterUsername';
import {Route, Router, Switch} from "react-router-dom"



function App() {
  return (
      <Switch>
        <Route exact path="/" component={LoginPage} />
        <Route exact path="/register" component={RegisterPageUsername} />
        <Route exact path="/main" component={MainStatusPage} />
        <Route exact path="/register2" component={RegisterPageAddress}/>
      </Switch>
  );
}

export default App;
